@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:Account rdf:type owl:Class .
atm:Bank rdf:type owl:Class .
atm:CashCard rdf:type owl:Class .
atm:Customer rdf:type owl:Class .

atm:ownsCard rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy rdf:type owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:Password rdf:type owl:Class .
atm:InvalidPassword rdf:type owl:Class ;
    rdfs:subClassOf atm:Password .

atm:Message rdf:type owl:Class .
atm:BadPasswordMessage rdf:type owl:Class ;
    rdfs:subClassOf atm:Message .

atm:hasPassword rdf:type owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Password .

atm:sendsMessage rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:Message .

atm:receivesMessage rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Message .

atm:InvalidPassword rdfs:subClassOf [
    rdf:type owl:Restriction ;
    owl:onProperty atm:hasPassword ;
    owl:someValuesFrom [
        rdf:type owl:Restriction ;
        owl:onProperty atm:sendsMessage ;
        owl:someValuesFrom atm:BadPasswordMessage
    ]
] .

atm:ATM rdfs:subClassOf [
    rdf:type owl:Restriction ;
    owl:onProperty atm:receivesMessage ;
    owl:someValuesFrom atm:BadPasswordMessage
] .
